import { Doughnut } from "react-chartjs-2";
import { Bar, Line, Pie } from "react-chartjs-2";
const Chart = () => {
  const chartData = [1, 2, 3, 4, 5, 6, 7, 8, 9];
  return (
    <Bar
      data={chartData}
      width={100}
      height={50}
      options={{ maintainAspectRatio: false }}
    />
  );
};

export default Chart;
